import React from 'react';
import './App.css';
import {useState,useEffect} from 'react';
import {Header} from '/conm/index'


function App() {
  const [message,setMessage] = useState('');
  useEffect(() =>{
    fetch('/api')
      .then((res) => res.json())
      .then((data) => setMessage(data.message));
  },[])
  return (
    <div>
      <h1>frontend</h1>
      <p> {message} </p>
    </div>
  );
}

export default App;
